import React from 'react';

const Card = ({card}) => {
  return (
    <div className="card-container">
      <div className="card">
        <div className="card-front">
          <p className="black-text">Question:</p>
          {card.front}
        </div>
        <div className="card-back">
          <p className="black-text">Answer: </p>
          {card.back}
        </div>
      </div>
    </div>
  )
};

export default Card;
